// Grommet
import {
  Grommet,
  Box,
  Heading,
} from 'grommet';

// Theme
import theme from './theme/theme.js';

const HomePage = () => (
  <Grommet>
    <Box
      background="blue"
      height="100vh"
      width="100%"
      align="center"
      justify="center"
    >
      <Heading level="1">
        NO
      </Heading>
    </Box>
  </Grommet>
);

export default HomePage;
